import React from "react";
import Header from "./Header.js";
import Footer from "./Footer.js";
import Notes from "./Notes.js";
import notes from "../notes.js";


function App(){
    return (
        <div>
          <Header />
        { notes.map(function (n){
         <Notes 
         note_title = {notes[0].title}
         note_content = {notes[0].content}
           />

        })
}
          <Footer />
        </div>

    );

}

export default App;
